import * as React from 'react';
import { styled } from '../../stitches.config';

interface GameHeaderProps {
	showInfo: boolean;
	stage: number;
	time: number;
	score: number;
}

const GameHeader: React.FC<GameHeaderProps> = ({
	showInfo,
	stage,
	time,
	score,
}) => {
	return (
		<Header>
			<Typo>
				<span>스테이지</span>
				<span>:</span>
				<span>{stage}</span>
			</Typo>
			<Typo>
				<span>time</span>
				<span>:</span>
				<span>{time}</span>
			</Typo>
			<Typo>
				<span>score</span>
				<span>:</span>
				<span>{score}</span>
			</Typo>
		</Header>
	);
};

export default GameHeader;

const Header = styled('div', {
	width: 286,
	display: 'flex',
	flexDirection: 'column',
	marginBottom: 16,
});

const Typo = styled('span', {
	fontFamily: '$default',
	fontSize: '$2',
	fontWeight: '$2',
	lineHeight: 1.4,
	color: '$veryPeri',
	textTransform: 'uppercase',
});
